    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in July of 1936. The month of July was the hottest
    and driest in recent history according to unofficial reports. Duck perished as the
    sloughs, lakes and creeks dried up. Much time was spent touring the countryside
    looking for stranded ducks. These ducks (and other waterfowl) were collected, banded
    and rehabilitated for release. Overall waterfowl production was good with many broods
    of ducks successfully hatched. A number of nesting studies were done which disclosed
    information on hatching success, clutch sizes and predation numbers. Other topics
    covered in this report are food and cover planting, headquarters development and
    photographs.",nt"license_title": "License Not Specified",nt"extras":
